import './App.css';
import Preloader from './Components/Utilities/Preloader';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div>
      <Routes>
        <Route path='/' element={<Preloader/>}/>
      </Routes>
    </div>
  );
}

export default App;
